description:
Nieuwe serie over een analyst die werkt bij een denktank van de overhead. Hij komt erachter dat een van de werknemers mogelijk betrokken is bij een geheime organisatie die de wereld op grote schaal manipuleren.

Addressing API staffers, Spangler declares the tanker attack to be a massive intelligence failure and urges his staff to &quot;come back with the truth&quot; about the perpetrators. 


